import React from "react";
import {Btn, ButtonsGroup} from "../../../../components/common/form_components";

function OrderFormControls(props) {
    return (
        <ButtonsGroup>
            <Btn variant="outlined" onClick={props.onBack}>Назад</Btn>
            <Btn variant="contained" onClick={props.onClear}>Очистить</Btn>
            <Btn variant="contained" type="submit" label="Submit">Заказать</Btn>
        </ButtonsGroup>
    )
}

export default OrderFormControls
